function incremovableSubarrayCount(nums: number[]): number {
    let count = 0;

    for (let i = 0; i < nums.length; i++) {
        for (let j = i; j < nums.length; j++) {
            if (isStrictlyIncreasing(nums, i, j)) {
                count++;
            }
        }
    }

    return count;
}

function isStrictlyIncreasing(nums: number[], start: number, end: number): boolean {
    let prev = start > 0 ? nums[start - 1] : -Infinity;
    for (let i = end + 1; i < nums.length; i++) {
        if (nums[i] <= prev) {
            return false;
        }
        prev = nums[i];
    }
    return true;
}
